const SecondIndex = () => import('./franchisedStoreInformationInfo.vue');
import {
     getAgentInfoListAPI,
     delAngetuserAPI
} from '@/api/agentInformationApi.js'
export default {
    name:'prodList',
    data(){
        return{
            form:{
                size:10,
                current:1,
                levelId:9,
                search:''
            },
            reviewedList:{
                1:'审核通过',
                0:'未通过'
            },
            agentId:'',
            value1:[,],
            shoptypelist:[{name:'出售中',val:'1',nownum:''},{name:'已下架',val:'2',nownum:''},{name:'库存预警',val:'3',nownum:''}],
            shoptype:1,
            shopClassification:'',
            ommodityType:'',
            searchshow:false,
            keyword:"",
            tableData:[],
            totalCount:0,
            tableLoading:false,
            secondDepShow:false,
          
        };
    },
    components:{
        SecondIndex,
    },
    methods:{
       
        /**
         * @msg: 翻页
         * @param {type} 
         * @return: 
         */
        handleSizeChange(cSize) {
            this.form.size = cSize;
            this.getStockList();
        },
        changeshow(){
            this.searchshow=!this.searchshow
        },
        delangetuser(id){
            this.$confirm('确定要删除该用户么？（此操作不可逆）', '提示', {
                confirmButtonText: '确定',
                cancelButtonText: '取消',
                type: 'warning'
            })
                .then(() => {
                    delAngetuserAPI(id)
                    .then(res => {
                        if(res.data.code === 200){
                            this.$message({
                                type: 'success',
                                message: '该用户已经删除',
                            });
                            this.getStockList()
                        }else{
                            this.$message.error(res.data.msg)
                        }                   
                    })
                    .catch(err => {
                    })
                })
        },
        changeagentdetail(id){
            this.secondDepShow=true
            this.agentId=id
        },
       
        handleCurrentChange(currentPage) {
            this.form.current = currentPage;
            this.getStockList();
        },
        getStockList(){
            const params = {...this.form};
            this.tableLoading = true;
             getAgentInfoListAPI(params)
                .then(res => {
                    const data = res.data.data;
                    this.totalCount = data.total;
                    this.tableData = data.records;
                    this.tableLoading = false;
                })
                .catch(err => {
                    this.tableLoading = false;
                })
        }
    },
    created(){
        this.getStockList()
    }
}
